import React from "react"

class Software extends React.Component {

  render() {
    return (
      <div>
        <h3>Address</h3>
        <code>{this.props.address}</code>
        <h3>Port</h3>
        <code>{this.props.port}</code>
      </div>
    )
  }

}

export default Software
